                        0,
                        0,
                        8
                     )
                  CurrentValueFrame.Size = pos1
                  Zip.Position = pos
                  local value = math.floor(((pos.X.Scale * max) / max) * (max - min) + min)
                  ValueLabel.Text = tostring(value)
                  pcall(callback, value)
